import React  from "react";
import { Route, Routes } from "react-router-dom";
import Home from './Home';


const App = () =>{
    return ( 
    <>
    <Routes>
    <Route path="/" component = {Home} /> 
    <Route path="/" component = {Home} /> 
    <Route path="/" component = {Home} /> 
    <Route path="/" component = {Home} /> 
</Routes>
    </>
    );
};

export default App;
